"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[1390],{11674:(e,t,i)=>{i.r(t),i.d(t,{default:()=>n,johnChapter15PL:()=>a});const a={chapter:15,title:"Jean 15",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Jam jest winny krzew prawdziwy, a Ojciec m\xf3j jest winnikiem.",strong:[]},{number:2,text:"Ka\u017cd\u0105 latoro\u015bl, kt\xf3ra we mnie nie przynosi owocu, odejmuje; a ka\u017cd\u0105, kt\xf3ra przynosi owoc, oczyszcza, aby wi\u0119cej owocu przynosi\u0142a.",strong:[{text:"Tout",strong:"G3956",start:0,end:4},{text:"tout",strong:"G3956",start:78,end:82},{text:"monde",strong:"G2889",start:117,end:122}]},{number:3,text:"Ju\u017ce\u015bcie wy czy\u015bci dla s\u0142owa, kt\xf3rem wam m\xf3wi\u0142.",strong:[{text:"parole",strong:"G3056",start:35,end:41}]},{number:4,text:"Mieszkajcie we mnie, a ja w was. Jako latoro\u015bl nie mo\u017ce przynosi\u0107 owocu sama z siebie, je\u017ali nie b\u0119dzie mieszka\u0142a w winnym krzewie, tak i wy, je\u017ali we mnie mieszka\u0107 nie b\u0119dziecie.",strong:[{text:"Comme",strong:"G2531",start:43,end:48},{text:"demeure",strong:"H1004",start:105,end:112}]},{number:5,text:"Jam jest winny krzew, a wy jeste\u015bcie latoro\u015ble. Kto mieszka we mnie, a ja w nim, ten przynosi wiele owocu; bo beze mnie nic uczyni\u0107 nie mo\u017cecie.",strong:[{text:"demeure",strong:"H1004",start:50,end:57},{text:"demeure",strong:"H1004",start:78,end:85},{text:"beaucoup",strong:"G4183",start:92,end:100},{text:"rien",strong:"G3762",start:139,end:143},{text:"faire",strong:"G1080",start:144,end:149}]},{number:6,text:"Je\u017ali kto we mnie nie mieszka, b\u0119dzie wyrzucony precz jako latoro\u015bl, i uschnie; a zbieraj\u0105 je, i w ogie\u0144 wrzucaj\u0105, i gorzej\u0105.",strong:[{text:"demeure",strong:"H1004",start:16,end:23},{text:"comme",strong:"G2531",start:56,end:61}]},{number:7,text:"Je\u017ali b\u0119dziecie mieszkali we mnie, a s\u0142owa moje w was mieszka\u0107 b\u0119d\u0105, o cokolwiek by\u015bcie chcieli, prosi\u0107 b\u0119dziecie, a stanie si\u0119 wam.",strong:[]},{number:8,text:"W tem b\u0119dzie uwielbion Ojciec m\xf3j, aby\u015bcie wiele owocu przynosili, a b\u0119dziecie uczniami moimi.",strong:[{text:"beaucoup",strong:"G4183",start:15,end:23}]},{number:9,text:"Jako mi\u0119 umi\u0142owa\u0142 Ojciec, tak i ja was umi\u0142owa\u0142em; mieszkajcie w mi\u0142o\u015bci mojej.",strong:[{text:"Comme",strong:"G2531",start:0,end:5},{text:"dans",strong:"H6887",start:57,end:61},{text:"amour",strong:"G25",start:66,end:71}]},{number:10,text:"Je\u017ali b\u0119dziecie strzedz przykaza\u0144 moich, b\u0119dziecie mieszkali w mi\u0142o\u015bci mojej, jakom ja strzeg\u0142 przykazania Ojca mego, i mieszkam w mi\u0142o\u015bci jego.",strong:[{text:"dans",strong:"H6887",start:50,end:54},{text:"amour",strong:"G25",start:59,end:64},{text:"demeure",strong:"H1004",start:130,end:137},{text:"dans",strong:"H6887",start:138,end:142},{text:"amour",strong:"G25",start:147,end:152}]},{number:11,text:"To wam m\xf3wi\u0142em, aby rado\u015b\u0107 moja w was by\u0142a, a rado\u015b\u0107 wasza aby by\u0142a zupe\u0142na.",strong:[]},{number:12,text:"To jest przykazanie moje, aby\u015bcie si\u0119 spo\u0142ecznie mi\u0142owali, jakom ja was umi\u0142owa\u0142.",strong:[{text:"commandement",strong:"G1785",start:14,end:26},{text:"comme",strong:"G2531",start:59,end:64}]},{number:13,text:"Wi\u0119kszej nad t\u0119 mi\u0142o\u015bci \u017caden nie ma, tylko gdy kto dusz\u0119 swoj\u0119 po\u0142o\u017cy za przyjacio\u0142y swoje.",strong:[{text:"grand",strong:"G3173",start:21,end:26},{text:"amour",strong:"G25",start:27,end:32},{text:"donner",strong:"G1325",start:40,end:46}]},{number:14,text:"Wy jeste\u015bcie przyjaciele moi, je\u017ali czyni\u0107 b\u0119dziecie, co ja wam przykazuj\u0119.",strong:[]},{number:15,text:"Ju\u017c was nie nazw\u0119 s\u0142ugami; bo s\u0142uga nie wie, co czyni pan jego; ale nazwa\u0142em was przyjaci\xf3\u0142mi, \u017cem wam oznajmi\u0142 wszystko, com s\u0142ysza\u0142 od Ojca mego.",strong:[{text:"serviteur",strong:"G1401",start:49,end:58},{text:"tout",strong:"G3956",start:161,end:165}]},{number:16,text:"Nie wy\u015bcie mi\u0119 obrali, ale ja was obra\u0142em, i postanowi\u0142em was, aby\u015bcie szli i owoc przynosili, a owoc wasz aby zosta\u0142; aby, czegokolwiek by\u015bcie prosili Ojca w imieniu mojem, da\u0142 wam.",strong:[{text:"demeure",strong:"H1004",start:161,end:168}]},{number:17,text:"To wam przykazuj\u0119, aby\u015bcie si\u0119 spo\u0142ecznie mi\u0142owali.",strong:[{text:"aimer",strong:"G25",start:39,end:44}]},{number:18,text:"Je\u017ali was \u015bwiat ma w nienawi\u015bci, wiedzcie, \u017ce mi\u0119 pierwej ni\u017c was mia\u0142 w nienawi\u015bci.",strong:[{text:"monde",strong:"G2889",start:6,end:11}]},{number:19,text:"By\u015bcie byli z \u015bwiata, \u015bwiat by mi\u0142owa\u0142, co jest jego; ale i\u017ce\u015bcie nie s\u0105 z \u015bwiata, alem ja was z \u015bwiata obra\u0142, przeto\u017c was \u015bwiat ma w nienawi\u015bci.",strong:[{text:"monde",strong:"G2889",start:17,end:22},{text:"monde",strong:"G2889",start:27,end:32},{text:"monde",strong:"G2889",start:94,end:99},{text:"monde",strong:"G2889",start:140,end:145},{text:"monde",strong:"G2889",start:166,end:171}]},{number:20,text:"Pami\u0119tajcie na s\u0142owo, kt\xf3rem wam powiedzia\u0142: Nie jest s\u0142uga wi\u0119kszy nad pana swego. Je\u017ali mi\u0119 prze\u015bladowali, i was prze\u015bladowa\u0107 b\u0119d\u0105; je\u017ali s\u0142owa mego strzegli, i waszego strzedz b\u0119d\u0105.",strong:[{text:"parole",strong:"G3056",start:20,end:26},{text:"serviteur",strong:"G1401",start:51,end:60},{text:"grand",strong:"G3173",start:76,end:81},{text:"parole",strong:"G3056",start:170,end:176}]},{number:21,text:"Ale to wszystko wam czyni\u0107 b\u0119d\u0105 dla imienia mego; przeto i\u017c nie znaj\u0105 tego, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[]},{number:22,text:"Bym ja nie by\u0142 przyszed\u0142, i nie m\xf3wi\u0142 im, nie mieliby grzechu; ale teraz wym\xf3wki nie maj\u0105 od grzechu swego.",strong:[]},{number:23,text:"Kto mi\u0119 ma w nienawi\u015bci, i Ojca mego ma w nienawi\u015bci.",strong:[]},{number:24,text:"Bym ja nie by\u0142 czyni\u0142 mi\u0119dzy nimi spraw, kt\xf3rych \u017caden inszy nie czyni\u0142, nie mieliby grzechu; ale teraz i widzieli, i mieli w nienawi\u015bci i mnie, i Ojca mego.",strong:[]},{number:25,text:"Ale si\u0119 to dzieje, aby si\u0119 wype\u0142ni\u0142o s\u0142owo, kt\xf3re jest napisano w zakonie ich: \u017be mi\u0119 mieli w nienawi\u015bci darmo.",strong:[{text:"parole",strong:"G3056",start:45,end:51},{text:"dans",strong:"H6887",start:67,end:71}]},{number:26,text:"Ale gdy przyjdzie on Pocieszyciel, kt\xf3rego ja wam po\u015bl\u0119 od Ojca, Duch prawdy, kt\xf3ry od Ojca pochodzi, on \u015bwiadczy\u0107 b\u0119dzie o mnie.",strong:[{text:"Esprit",strong:"G4151",start:75,end:81}]},{number:27,text:"Ale i wy \u015bwiadczy\u0107 b\u0119dziecie; bo jeste\u015bcie ze mn\u0105 od pocz\u0105tku.",strong:[{text:"avec",strong:"G1848",start:60,end:64},{text:"commencement",strong:"G746",start:76,end:88}]}]},n=a}}]);
